// import Index from "./Pages/RouterChallange/Index";
import axios from "axios";

const App = () => {
  const params = {
    access_key: "974301f1ed1b08d338aff5f1eb3e0184",
    query: "Ulaanbaatar",
  };

  axios
    .get("https://api.weatherstack.com", { params })
    .then((response) => {
      const apiResponse = response.data;
      console.log(
        `Current temperature in ${apiResponse.location.name} is ${apiResponse.current.temperature}℃`
      );
    })
    .catch((error) => {
      console.log(error);
    });
  return <div>Home</div>;
};

export default App;
